import "./Item.css";
export default function Item({item}) {
    return (
       

        <div class="card">
                <div className="itemImg" style={{backgroundImage: url(item.image)}} class="card-img-top" alt=""/>
                <div >
                    <p >{item.price}</p>
                    <h5 >{item.name}</h5>
                    <h6 >{item.description.short}</h6>
                    <p>more...</p>
                </div>
        </div>
 
    )
}
